const Welcome = () => {
  return (
    <div>
      <h1>
        Hello World
      </h1>
    </div>
  )
}

const App = () => {
  return (
    <div className="App">
      <div className="Into">
        <Welcome/>
        <Typical
          loop={1}
          wrapper="b"
          steps={
            [ 'Hello there!', 1000,
              'My name is arnob!', 2000
            ]
          }
          >
        </Typical>
      </div>

    </div>
  );
}


export default App;
